  const goods = useSelector(selectGoods);
  const dispatch = useDispatch();

  const clickHandler = (event) => {
    // Обработка клика здесь, если это необходимо
  };

  return (
    <div onClick={clickHandler}>
      {goods.map((item) => (
        <Goods
          title={item.title}
          price={item.price}
          image={item.image}
          id={item.id}
          key={item.id}
        />
      ))}
    </div>
  );
}

export default GoodsList;
